import React from 'react'
import CartItem from './CartItem';


const CartList = ({ cart }) => {
  //console.log(cart)
  return (
    <div className="container-fluid">
      {cart.map(item => {
        return (
          <CartItem key={item.id} />
        )
      })}


    </div>);
}

export default CartList;
